import React from 'react';
import styles from './MenuComponent.module.css'
import { Grid, Image, Segment } from 'semantic-ui-react'

interface Props {
  name: string
}

interface State {
  count: number
  developerName: string
}

export class MenuComponent extends React.Component<{}, State> {

  constructor(props: {}) {
    super(props)
  }

  render() {
    return (
      <>
      <Grid className={styles.Spaced}>
        <Grid.Column width={10} />
        <Menu text stackable>

          <a href="#projects" class="item">
            Projects
          </a>
          <a class="item" href="#skills">
            Skills
          </a>
          <a class="item" href="#resume">
            Resume
          </a>
          <a href="#contact" class="item">
            Contact
          </a>

        </Menu>
      </Grid>
      </>
    )
  }
}
